import React from "react";

const Signature = () => {
  return (
    <div id="signature" style={{ textAlign: "center" }}>
      <sub>Crimson Claw Jewelry & Apparel, copyright 2020.<br/> SPA v1.0 Built with Love by <a href="https://kieran815.github.io" target="_blank" rel="noopener noreferrer">Kieran Milligan</a> using React</sub>
    </div>
  );
}

export default Signature;
